import { palette } from 'styled-theme';

const FormFieldTitle = styled.h3`
  font-size: 14px;
  font-weight: 700;
  color: ${palette('text', 0)};
  margin: 0 0 10px;
  display: block;
`;

export { FormFieldTitle };
